io.on('connection', socket => {
    socket.on('firstFetch', () => {
        io.emit('returnMoney', money)
        socket.emit('returnProducts', products)
    })
    socket.on('buyProduct', (payload) => {
        for (let i = 0; i < products.length; i++) {
            if(products[i].id == payload && products[i].quantity > 0) {
                products[i].quantity -= 1
                money -= products[i].price
            }
        }
        io.emit('returnMoney', money)
        io.emit('returnProducts', products)
    })
});

